    [],nt"revision_timestamp": "2016-07-27T22:19:57.504076",nt"name": "environmental-assessment-land-protection-plan-and-conceptual-management-plan-ellicott-slou",nt"isopen":
    false,nt"url": null,nt"notes": "Ellicott Slough National Wildlife Refuge
    (Refuge) was established in 1975 for the protection of the endangered Santa Cruz
    long-toed salamander (SCLTS). There are 170 acres of Refuge owned land adjacent
    to the 30-acre Santa Cruz Long-toed Salamander Ecological Reserve which is owned
    by California Department of Fish and Game (CDFG). Both properties are managed cooperatively
    as the Ellicott Slough National Wildlife Refuge and State Ecological Reserve (Figure
    1). The Refuge protects 2 of the 11 remaining SCLTS breeding sites, as well as the
    surrounding uplands which serve as nonbreeding habitat for the salamander. The Service
    proposes to add approximately 289 acres of land to the Ellicott Slough National
    Wildlife Refuge by acquiring the Buena Vista property with CDFG and managing the
    entire property as part of the Refuge (Figure 2). This Environmental Assessment
    provides analysis and documentation for National Environmental Policy Act compliance.",nt"license_title":
